/* Start Accordion */

/* Core styles/functionality */
.tab input {
  position: absolute;
  opacity: 0;
  z-index: -1;
}
.tab__content {
  max-height: 0;
  overflow: hidden;
  transition: all 0.1s;
}
.tab input:checked ~ .tab__content {
  max-height: fit-content;
}

/* Visual styles */
.accordion {
  overflow: hidden;
	background-color: #008349;
	color: #fff;
}
.tab__label,
.tab__close {
  display: flex;
  color: black;
  cursor: pointer;
}
.tab__label {
  justify-content: space-between;
  padding: 1rem;
	color: #fff;
}
.tab__label:hover {
	color: #f2d665;
}
.tab__label::after {
  content: "\276F";
  width: fit-content;
	height: fit-content;
	position: relative;
	right: 8px;
  text-align: center;
  transform: rotate(90deg);
}
.tab input:checked + .tab__label::after {
  transform: rotate(270deg);
  right: 12px;
}
.tab__content p {
  margin: 0;
  padding: 1rem;
}
.tab__close {
  justify-content: flex-end;
  padding: 0.5rem 1rem;
  font-size: 0.75rem;
}
.accordion--radio {
  background-color: #ff5252;
}
.tab__content a {
	color: #fff;
	padding: 5px;
}
.hidden-menu-links {
	display: flex;
  flex-direction: column;
  margin-left: 30px;	
}
.accordion.sub .tab:last-child .hidden-menu-links {
	padding-top: 16px;
}
.accordion.sub .tab__label {
	padding: 5px 16px 5px 5px;
}
.accordion.sub .tab__label .hidden-menu-links {
	margin-left: 25px;
}
.tab__content a:hover {
	color: #f2d665;
}
.accordion.acreditation .tab__label {
	margin-bottom: 0;
}
.accordion > .tab:last-child .hidden-menu-links {
	margin-bottom: 11px;
}

.about-departament {
	display: flex;
}
.about-departament .ab-text {
	flex: 0.7;
}
.about-departament .ab-name {
	flex: 0.3;
}

.name-adaptive {
	width: 101%;
	padding-right: 10px;
}

/* Start Arrow animation */

.tab input:not(:checked) + .tab__label:hover::after {
  animation: bounce .5s infinite;
}

/* End Arrow animation */

@keyframes bounce {
  25% {
    transform: rotate(90deg) translate(.25rem);
  }
  75% {
    transform: rotate(90deg) translate(-.25rem);
  }
}

/* End Accordion */

